import { Box, makeStyles, Grid, List, ListItem, ListItemText, ListSubheader, Hidden } from "@material-ui/core";
import React from "react";
import Image6 from "../icons/image6";

const useStyles = makeStyles(() => ({
  footer: {
    backgroundColor: "#0C0C0C",
    color: "white",
    "& .MuiListSubheader-root": {
      color: "white",
    }
  },
  image: {
    height: "100px",
    width: "auto"
  }
}));

const Footer: React.FunctionComponent = () => {
  const classes = useStyles();

  return (
    <Box className={classes.footer} px={10} py={6}> 
    <Grid container>
    <Grid item sm={3} xs={12}>
      <List subheader={<ListSubheader>Settings</ListSubheader>}>
      <ListItem>
        <ListItemText primary="Wi-Fi" />
      </ListItem>
      <ListItem>
        <ListItemText primary="Bluetooth" />
      </ListItem>
    </List>
    </Grid>
    <Grid item sm={3}  xs={12}>
      <List subheader={<ListSubheader>Settings</ListSubheader>}>
      <ListItem>
        <ListItemText primary="Wi-Fi" />
      </ListItem>
      <ListItem>
        <ListItemText primary="Bluetooth" />
      </ListItem>
    </List>
    </Grid>
    <Grid item sm={3}  xs={12}>
      <List subheader={<ListSubheader>Settings</ListSubheader>}>
      <ListItem>
        <ListItemText primary="Wi-Fi" />
      </ListItem>
      <ListItem>
        <ListItemText primary="Bluetooth" />
      </ListItem>
    </List>
    </Grid> 
    <Hidden xsDown><Grid item sm={3} >
    <Image6 className={classes.image}/>

    </Grid>
    </Hidden>
    </Grid>
    </Box>
  );
};

export default Footer;
